import React from 'react'

const DataRow = ({ d }) => {

  const date = d.date.toLocalString()

  if (d === undefined) {
    return null
  }

  return (
    <>
      <tr>
        <td>{d.farm.name}</td>
        <td>{date}</td>
        <td>{d.value}</td>
      </tr>
    </>
  )
}

export default DataRow
